import json

from scalecodec import ScaleBytes
from scalecodec.base import Singleton, ScaleDecoder
from scalecodec.block import ExtrinsicsDecoder, EventsDecoder, LogDigest
from scalecodec.metadata import MetadataDecoder

from libs import rpc_pb2, rpc_pb2_grpc

DarwiniaMetadataV6 = ""
Kusama1003 = ""
Kusama1006 = ""
Kusama1008 = ""
Kusama1010 =""
Decoder = None


class MetadataV6Instant(metaclass=Singleton):
    Decoder = None

    def __init__(self):
        if self.Decoder is None:
            self.Decoder = MetadataDecoder(ScaleBytes(DarwiniaMetadataV6))
            self.Decoder.decode()


class MetadataKusamaInstant(metaclass=Singleton):
    Decoder = None

    def __init__(self):
        if self.Decoder is None:
            self.Decoder = MetadataDecoder(ScaleBytes(Kusama1003))
            self.Decoder.decode()


